script: |
  super -f text -I q3248.spq | sort > q3248.out

inputs:
  - name: q3248.spq
    data: |
      SELECT + col1 * - + col0 - + 92 + - + col2 * + 18 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + + col1 ) BETWEEN - 18 AND NULL;
  - name: tab1

outputs:
  - name: q3248.out
    data: |
